from collections import deque

def movesToStamp(stamp: str, target: str) -> list[int]:
    (M, N) = (len(stamp), len(target))
    (queue, done) = (deque(), [False] * N)
    A = []
    for i in range(N - M + 1):
        (made, todo) = (set(), deque())
        for j in range(M):
            if target[i + j] == stamp[j]:
                made.add(i + j)
            else:
                todo.append((i + j, stamp[j]))
        A.append((made, todo))
    ans = []
    while queue and any((not A[i][1] for i in range(N - M + 1) if not done[i])):
        queue = deque([i for i in range(N - M + 1) if not done[i] and (not A[i][1])])
        for i in queue:
            ans.append(i)
            for b in A[i][0]:
                done[b] = True
    return ans[::-1] if all(done) else []

